script: |
  super -f text -I q273.spq | sort > q273.out

inputs:
  - name: q273.spq
    data: |
      SELECT DISTINCT + 91 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col0 BETWEEN - + 33 * - + col0 AND + ( - 23 ) * - col2 * - - col1;
  - name: tab0

outputs:
  - name: q273.out
    data: |
      91
